import React from 'react';
import Home from './Home';
import Skills from './Skills';
import Projects from './Projects';
import Certification from './Certification';
import Contact from './Contact';

const App = () =>{
    return(
        <>
        <Home/>
        <Skills/>
        <Projects></Projects>
        <Certification/>
        <Contact></Contact>
        </>
    )
};

export default App;
